import React, { Component } from "react";
import axios from "axios";

export default class TestNote extends Component {
  constructor(props) {
    super(props);

    this.state = {
      username: "",
      password: "",
      todoList: "",
    };
  }

  render() {
    return (
      <div className="container">
        <form>
          <label>Username: </label>
          <input type="text" required value={this.state.username} />
        </form>
      </div>
    );
  }
}
